    void petFamilySelected(ChangeEventArgs e)
    {
        petFamily = Families.FirstOrDefault(i => i.Lastname.Equals(e.Value.ToString()));
    }

    async void addPet()
    {
        Pet newPet = new Pet();
        newPet.Name = petName;
        newPet.Age = (int) petAge;
        newPet.Species = petSpecies;
        var families = await FamilyService.GetFamilies();
        families.FirstOrDefault(i => i.Lastname.Equals(petFamily.Lastname)).Pets.Add(newPet);
    }



